import "./SearchPanel.css"
class SearchPanel extends Component{
    constructor(props){
        super(props);
        this.state = {
            term: ""
        }
    }
  render(){
    return(
        <input type="text" 
        className="searchInput"
        id="searchInput"
        placeholder="Найти сотрудника"
        />
    )
  }
}
export default SearchPanel;
